import * as React from 'react'
import { Pages } from '../../models'
import {
  LoginProvidersData,
  LoginWithProviderUseCase,
} from '@flashcards/client'

type Props = {
  loginWithProvider: LoginWithProviderUseCase
}

function Login({ loginWithProvider }: Props) {
  return (
    <main>
      <h1>Login</h1>
      {Object.keys(LoginProvidersData).map(provider => (
        <button
          key={provider}
          onClick={() => {
            loginWithProvider(provider as LoginProvidersData).then(user => {
              console.log('user', user)
            })
          }}
        >
          {provider}
        </button>
      ))}
    </main>
  )
}

Login.displayName = Pages.Login

export { Login }
